INSERT INTO `qs_course1` VALUES (1,'节点介绍','__static__/videos/picture/1_1.jpg','__static__\\videos\\1-1.mov','物联网实验箱采用一系列传感器模块、执行器模块、无线通讯模块和嵌入式芯片组成无线通讯低功耗广域网、Web服务器广域网，可实现多种物联网架构，完成物联网相关的信息采集、无线信号收发，LoRa低功耗广域网通信、组建控制全过程多种教学实验和网络通讯技术开发。'),(2,'传感器实验','__static__/videos/picture/1_2.jpg','__static__\\videos\\1-2.mov','您可以初步学习到通过上位机软件和主节点，控制相应的LoRa低功耗广域网子节点进行相应的操作。'),(3,'电子驱蚊器应用','__static__/videos/picture/1_3.jpg','__static__\\videos\\驱蚊器DEMO.mov','电子驱蚊器。怀孕的雌蚊会非常避讳与雄蚊再次交配，因为这会影响卵巢发育，导致雌蚊死亡。所以我们就可以通过模仿雄蚊飞行的声音，让吸血的雌蚊远离人类。');
